  return (
    <Router>
      <div className='header'>
          <ul>
            <li><Nav.Link href="/Menu">Menu</Nav.Link></li>
            <li><a>Api</a></li>
            <li><a>Lessons</a></li>
            <li className='right'><a className='active'>Coming soon</a></li>

          </ul>
      </div>
      <Switch>
      <Route exact path="/Menu" component={Menu} />
      </Switch>
    </Router>
  )
}


export default Header;
